import React from "react";
import styles from "./Header.module.css";
import mealsImage from' ../../assets/meals.jpg';
const Header = () => {
  return <Fragment>
   <header className={styles.header}>
    <h1>Itrapindi Food Corner</h1>
    <button>Cart</button>
   </header>
   <div>
    <img src={mealsImage } alt="All your food items at one place" className={styles['main-image']}/>
   </div>
  </Fragment>;
};

export default Header;
